import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function listed() {}

function App() {
  return (
    <div>
      <h1 className="heading">My Favourites</h1>
      <Card
        name={contacts[0].name}
        image={contacts[0].imgURL}
        alt={contacts[0].name}
        instagram={contacts[0].instagram}
      />
      <Card
        name={contacts[1].name}
        image={contacts[1].imgURL}
        alt={contacts[1].name}
        instagram={contacts[1].instagram}
      />
      <Card
        name={contacts[2].name}
        image={contacts[2].imgURL}
        alt={contacts[2].name}
        instagram={contacts[2].instagram}
      />
      <Card
        name={contacts[3].name}
        image={contacts[3].imgURL}
        alt={contacts[3].name}
        instagram={contacts[3].instagram}
      />
      <Card
        name={contacts[4].name}
        image={contacts[4].imgURL}
        alt={contacts[4].name}
        instagram={contacts[4].instagram}
      />
      <Card
        name={contacts[5].name}
        image={contacts[5].imgURL}
        alt={contacts[5].name}
        instagram={contacts[5].instagram}
      />
      <Card
        name={contacts[6].name}
        image={contacts[6].imgURL}
        alt={contacts[6].name}
        instagram={contacts[6].instagram}
      />
      <Card
        name={contacts[7].name}
        image={contacts[7].imgURL}
        alt={contacts[7].name}
        instagram={contacts[7].instagram}
      />
    </div>
  );
}

export default App;
